const App = () => {
  const [click, setClick] = useState({
    left: 0, right: 0
  })

  return (
    <div>
      {left}
      <button onClick={() => setLeft(left + 1)}>
        left
      </button>
      <button onClick={() => setRight(right + 1)}>
        right
      </button>
      {right}
      <button onClick={() => setLeft(0)}>
        reset
      </button>
    </div>
  )
}

export default App;
